import { Form, Input } from 'antd';
import React, { FormEvent, useState } from 'react'
import { useDispatch } from 'react-redux';
import { login } from '../redux/AuthCRUD';
import * as auth from "../redux/AuthRedux";

type Props = {}
interface Values {
  username: string;
  password: string;
  remember: boolean;
}
const Login = (props: Props) => {
  type LayoutType = Parameters<typeof Form>[0]["layout"];
  const [formLayout, setFormLayout] = useState<LayoutType>("vertical");
  const [loadings, setLoadings] = useState<boolean[]>([]);
  const dispatch = useDispatch();

  const onFinish = (values: Values) => {
    console.log("Received values of form: ", values);
    if (values.remember) {
      localStorage.setItem("username", values.username);
      localStorage.setItem("password", values.password);
    }
    setLoadings([true]);
    setTimeout(() => {
      login(values.username, values.password).then((response) => {
        console.log(response);

        const token = response.data.idToken;
        console.log(token);

        setLoadings([false]);
        dispatch(auth.actions.login(token));
      }).catch((error)=>{
        setLoadings([false]);

        console.log(error);

      });
    }, 1000);
  };

  const handleForgotPassword = (e: FormEvent) => {
    e.preventDefault();
    console.log("Handle password recovery logic here");
  };

  const handleRegister = (e: FormEvent) => {
    e.preventDefault();
    console.log("Handle registration logic here");
  };
  const tailLayout = {
    wrapperCol: { offset: 0, span: 16 },
  };
  return (
    <div className="container">
    <div className="layout__box">
      <div className="layout__boxHeader">
        <div className="layout__boxTitle">
          <h3>Login</h3>
        </div>
      </div>
      <div className="layout__body">
        <h2 className="auth__tagline">Find your study partner</h2>

        <Form className="form" action="" method="POST">
          {/* {% csrf_token %} */}
          <div className="form__group form__group">
            <label htmlFor="room_name">Email</label>
            <input id="username" name="email" type="email" placeholder="e.g. dennis_ivy@email.com" />
          </div>
          <Form.Item
                label="Username"
                name="username"
                rules={[
                  {
                    required: true,
                    message: "Please input your username!",
                  },
                ]}
              >
                <Input
                />
              </Form.Item>
          <div className=" form__group">
            <label htmlFor="password">Password</label>
            <input id="password" name="password" type="password"
              placeholder="&bull;&bull;&bull;&bull;&bull;&bull;&bull;&bull;" />
          </div>

           <button className="btn btn--main" onClick={onFinish}>
            <svg version="1.1" xmlns="http://www.w3.org/2000/svg" width="32" height="32" viewBox="0 0 32 32">
              <title>lock</title>
              <path
                d="M27 12h-1v-2c0-5.514-4.486-10-10-10s-10 4.486-10 10v2h-1c-0.553 0-1 0.447-1 1v18c0 0.553 0.447 1 1 1h22c0.553 0 1-0.447 1-1v-18c0-0.553-0.447-1-1-1zM8 10c0-4.411 3.589-8 8-8s8 3.589 8 8v2h-16v-2zM26 30h-20v-16h20v16z">
              </path>
              <path
                d="M15 21.694v4.306h2v-4.306c0.587-0.348 1-0.961 1-1.694 0-1.105-0.895-2-2-2s-2 0.895-2 2c0 0.732 0.413 1.345 1 1.694z">
              </path>
            </svg>

            Login
          </button>
        </Form>

        <div className="auth__action">
          <p>Haven't signed up yet?</p>
          <a href="#" onClick={handleRegister} className="btn btn--link">Sign Up</a>
        </div>
      </div>
    </div>
  </div>
  )
}

export default Login
